import React from "react";
import '../style/header.css'
import logo from '../logo.svg';

export class Header extends React.Component {
    constructor (props) {
        super(props)
        this.state = {
            list: [
                ['文章', ''],
                ['自省', ''],
                ['散心', '']
            ]
        }
    }

    render() {
        return (
            <div className="headerLine">
                <img alt="Home" src={logo} className="header-home"></img>
                <ul className="header-page">
                    {this.state.list.map((item) => <li className="header-page-item">{item[0]}</li>)}
                </ul>
                <h1>1223</h1>
            </div>
        )
    }
}
